class DummyExamsRepository extends ExamsRepository {
  const DummyExamsRepository() : super();

  @override
  Future<Exam> getExam(String examId) async {
    var exams = await getExams();

    return exams.firstWhere((element) => element.id == examId,
        orElse: () => Exam.empty);
  }

