  @override
  Future<List<Submission>> getSubmissions({required String examId}) async {
    final Exam? exam = (await getExams())
        .firstWhere((element) => element.id == examId, orElse: null);

    if (exam == null) return [];

    final String pdf1 =
        "";

    final answerBuilder = [
      (Task task) => Answer(
              task: task,
              achievedPoints: 0,
              status: CorrectableStatus.pending,
              segments: [
                AnswerSegment(
                    start: SegmentPosition(page: 0, y: 200),
                    end: SegmentPosition(page: 0, y: 400)),
              ]),
      (Task task) => Answer(
              task: task,
              achievedPoints: 0,
              status: CorrectableStatus.pending,
              segments: [
                AnswerSegment(
                    start: SegmentPosition(page: 0, y: 400),
                    end: SegmentPosition(page: 1, y: 0)),
              ]),
      (Task task) => Answer(
              task: task,
              achievedPoints: 0,
              status: CorrectableStatus.pending,
              segments: [
                AnswerSegment(
                    start: SegmentPosition(page: 1, y: 0),
                    end: SegmentPosition(page: 1, y: 600))
              ]),
    ];

    final answers = <Answer>[];

    for (int i = 0; i < exam.tasks.length; i++) {
      answers.add(answerBuilder[i](exam.tasks[i]));
    }

    return exam
        .getParticipants()
        .map((e) => Submission(
            id: "$examId _ ${e.id}",
            exam: exam,
            student: Student(id: e.id, displayName: e.displayName),
            data: pdf1,
            answers: answers,
            achievedPoints: 0,
            status: CorrectableStatus.pending))
        .toList(growable: false);
  }
}
